import React from 'react';
import UploadBar from './UploadBar'
import './css/Main.css'
import axios from 'axios';


const TO_DISPLAY = 8;

class Main extends React.Component {
    render() {
        axios.get('http://localhost:5000/file/download')
        .then((res) => {
            console.log(res);
        });
        return(
            <div className="center">
                <div className="row gy-4 main-grid mx-auto pt-3">
                    {
                        Array(TO_DISPLAY).fill(1).map((el, i) =>
                            <div className="col">
                                <div className="grid-item border border-secondary">Hello</div>
                            </div>
                        )
                    }
                </div>
                <UploadBar/>
            </div>
        )
    }
} 

export default Main;
